import axios from '../axiosConfig'


const ownedbooks =  async (username)=>{
    //console.log("inside login");
    
    try{
        const res = await axios.get('/books/bookByOwner/'+username);
        console.log(res);
        return res;

    }
    catch(err){
        
        console.log(err.res);}
    }
export {ownedbooks};
